// import AppRouter from '../Router/AppRouters.js';
import '../Styles/NavBar.css'
import { Link } from 'react-router-dom'

import {useLocation} from 'react-router-dom';

function NavBar(props) {
    // Project Function
    function handleProject() {        
        // window.scrollBy(0, 987);
        window.scroll({
            top:987,
            behavior: "smooth"
        })
        console.log('You clicked submit.');
    }

    // const navColorChange = ((props.navColor ==="#777777") ? "red":"blue").toString();
