    console.log(window.location.href)
    let currentPage = window.location.href
    let colorText = { color: 'white' };
    if (currentPage === "http://localhost:3000/home") {
        colorText = { color: 'white' };
    } 
    else {
        colorText = { color:'#777777' }
    }
    console.log('current Pathname üëâÔ∏è', window.location.pathname);
    console.log(colorText)
    const location = useLocation();
    console.log(location)


    let classNameChange = "box-this"


    return (
        <div>
            {/* <AppRouter/> */}
            {/* <div className="main-container" style={{color:{navColor}}}> */}
            <div className="main-container" >

                <div className="flex-child">
                    <div className={classNameChange} style={{backgroundColor: 'lime', color: 'white'}}></div>
                    {/* <p className="text-this">Home</p> */}
                    <button className="nav-button">
                        <Link style={{textDecoration: 'none'}} to="home">
                            <p className="text-this" style={colorText}>Home</p>
                        </Link>
                    </button>
                </div>
                <div className="flex-child">
                    <div className="box-this"></div>
                    <button className="nav-button" onClick={handleProject}>
