                        </Link>
                    </button>
                </div>
                <div className="flex-child">
                    <div className="box-this"></div>
                    {/* <p className="text-this">Photography</p> */}
                    <button className="nav-button">
                        <p className="text-this" style={colorText}>Gallery</p>
                    </button>
                </div>
                <div className="flex-child">
                    <div className="box-this"></div>
                    <a className="button-resume" href={require('../Documents/JonathanDominguez.pdf')} download="JonathanDominguez">
